x = ''
# x = '12345678'
pattern = [0, 1, 0, -1]
phase_in = x
for i in range(100):
  phase_out = ''
  for j in range(len(phase_in)):
    line_sum = 0
    for k, char in enumerate(phase_in):
      p = (k + 1) // (j + 1) % 4
      line_sum += int(char) * pattern[p]
    #   print(f'+ {char}*{pattern[p]} ', end='')
    # print(f'= {line_sum}')
    phase_out += str(line_sum)[-1]
  phase_in = phase_out
print(phase_in)
